        "privacyTerms": MessageLookupByLibrary.simpleMessage(
            "En vertu des lois vietnamiennes, les informations des utilisateurs telles que les noms, adresses e-mail, mots de passe et date de naissance peuvent être classées comme «informations personnelles.\n\n En particulier,\n (a) En vertu du décret 72/2013, les informations personnelles sont définies comme des informations qui sont jointes à l\'identification de l\'identité et des données personnelles d\'une personne, notamment son nom, son âge, son adresse, son numéro de carte d\'identité, son numéro de téléphone, son adresse e-mail et d\'autres informations. comme stipulé par la loi\n\n (b) Selon la circulaire 25/2010, les informations personnelles désignent les informations suffisantes pour identifier précisément une personne, qui comprennent au moins l\'une des informations suivantes: nom complet, date de naissance, profession, titre, adresse de contact, adresse e-mail, numéro de téléphone, identité numéro de carte et numéro de passeport. Les informations relatives à la vie privée comprennent le dossier de santé, le dossier de paiement des impôts, le numéro de carte d\'assurance sociale, le numéro de carte de crédit et d\'autres secrets personnels.\n\n La circulaire 25 s\'applique à la collecte et à l\'utilisation des informations personnelles par les sites Web gérés par les autorités gouvernementales vietnamiennes. La circulaire 25 n\'est pas directement applicable à la collecte et à l\'utilisation de renseignements personnels par des sites Web exploités par des entités non gouvernementales. Cependant, les dispositions de la circulaire 25 pourraient être appliquées par analogie. En outre, il est probable qu’une entité non gouvernementale soit soumise à des normes identiques ou plus strictes que celles applicables à une entité gouvernementale."),
